// import { jsPDF } from "jspdf"
const {
    jsPDF
} = window.jspdf;
var font = '';
var callAddFont = function () {
    this.addFileToVFS('LiberationSerif-normal.ttf', font);
    this.addFont('LiberationSerif-normal.ttf', 'LiberationSerif', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])